latestComments/4/text:
I recently ordered a mixer grinder from Myntra and received it on October 21, 2024. Unfortunately, the product arrived damaged. When I reached out to customer service to return it, I was told to ship the item back myself because my location is not eligible for pickup—even though the product was delivered to the same location. 
To make things worse, I had specifically chosen this product because it had a 7-day return policy at the time of purchase. Now, the return option has completely disappeared from the website. This is quite disappointing as it adds unnecessary hassle for the customer.
@Myntra, I hope you can address this and provide a smoother return process for your customers.

